import React,{Component} from 'react';
import {Link} from 'react-router-dom';
import './user.scss';
class User extends Component{
    render(){
        return(

            <div>

            <div className="header">

            <div className="header-left">取消</div>
            
            登陆
            </div>
            <Link to="/register" className="header-right">注册</Link>
            </div>
           
        )
    }
}
export default User;
